(function ($, window, document, undefined) {

    var name = 'Accordion';

    function Accordion(element, index, options) {
        this.$el = $(element);
        this.options = $.extend({}, $.USER.fn[name].defaults, options);
        this.init();
    }

    Accordion.prototype = {

        name: name,

        init: function () {

            var self = this;

            this.$toggle = this.$el.find('[data-class="accordion-toggle"]');
            this.$reveal = this.$el.find('[data-class="accordion-reveal"]');

            this.$toggle.on('click', function (e) {
                e.preventDefault();

                self.$reveal.slideToggle(200, function () {
                    self.$el.toggleClass('accordion__active')
                });
            });
        }
    };

    $.USER.fn.pluginGenerator(Accordion);

})
(jQuery, window, document);

$(function () {

    // Select all links with hashes
    $('a[href*="#"]')
    // Remove links that don't actually link to anything
        .not('[href="#"]')
        .not('[href="#0"]')
        .click(function (event) {
            // On-page links
            if (
                location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '')
                &&
                location.hostname == this.hostname
            ) {
                // Figure out element to scroll to
                var target = $(this.hash);
                target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
                // Does a scroll target exist?
                if (target.length) {
                    // Only prevent default if animation is actually gonna happen
                    event.preventDefault();
                    $('html, body').animate({
                        scrollTop: target.offset().top
                    }, 1000);
                }
            }
        });

});

$(function () {

    var $parentNavLi = $('.header .menu-item-has-children');

    $parentNavLi.each(function () {
        var $this = $(this),
            $link = $this.children('a'),
            $mobileToggle = $this.find('.mobileToggle'),
            $subMenu = $this.children('.sub-menu'),
            activeMobileClass = 'item-active-mobile',
            activeClass = 'item-active';

        $link.on('mouseenter', function () {
            $this.addClass(activeClass);
        });

        $this.on('mouseleave', function () {
            $this.removeClass(activeClass);
        });

        $mobileToggle.on('click', function (e) {
            e.preventDefault();
            $this.toggleClass(activeMobileClass);
            $subMenu.slideToggle();
        });
    });

    $('[data-class="header"]').USER_MobileNav();

});

(function ($, window, document, undefined) {

    var name = 'MobileNav';

    function MobileNav(element, index, options) {
        this.$el = $(element);
        this.options = $.extend({}, $.USER.fn[name].defaults, options);
        this.init();
    }

    MobileNav.prototype = {

        name: name,

        init: function () {

            var self = this;

            this.$toggle = this.$el.find('[data-class="nav__toggle"]');
            this.activeClass = 'nav__active';

            this.$toggle.on('click', function (e) {
                e.preventDefault();

                self.$el.toggleClass(self.activeClass);
            });
        }
    };

    $.USER.fn.pluginGenerator(MobileNav);

})
